Pdf / English / 1961 Tudor Publishing / 352 pag / 61 MB

&quot;This classic, Tudor History of Painting in 1000 Color Reproductions, was published in 1961. The format is two column, usually 3 small but crisp photos of Prehistoric Art to Abstract and American genres ending in the mid-20th century per page with a interior essay column. Focus is Europe 1300's-1800's.&quot;

